let itemsSelector = document.querySelector('#items');

exports.addItem = (item, isNew) => {
    let newItem = document.createElement('div');
    newItem.setAttribute("class", "item d-flex gap-2 py-2 border-bottom justify-content-between");
    newItem.setAttribute("data-uuid", item.uuid);
    newItem.innerHTML = `<div class="d-flex gap-2">
            <img src="${item.screenShot}"
                alt="${item.title}"
                class="item-image rounded img-thumbnail"
                style="height: 50px;"/>
            <div class="item-details d-grid">
                <div class="item-title w-100 overflow-hidden text-nowrap"
                    style="text-overflow: ellipsis;line-height: 24px;">${item.title}</div>
                <a href="${item.url}" target="_blank" class="item-description small text-muted">${item.url}</a>
            </div>
        </div>
        <div class="my-auto">
            <button class="btn btn-outline-danger btn-sm delete-item">&times;</button>
        </div>`;

    if (isNew) {
        this.saveItemInLocalStorage(item);
    }

    itemsSelector.appendChild(newItem);
}

exports.saveItemInLocalStorage   = (item) => {
    let items = this.getItemsFromLocalStorage();
    items.push(item);
    localStorage.setItem('items', JSON.stringify(items));
}
exports.getItemsFromLocalStorage = () => JSON.parse(localStorage.getItem('items')) || [];
exports.setItemsFromLocalStorage = (checkItems = null) => {
    let items = this.getItemsFromLocalStorage();
    //localStorage.setItem('items', "[{\"title\":\"Google\",\"uuid\":\"466d2a9a-3977-4b72-81e3-5e41b3062a54\",\"screenShot\":\"data:image/png;base64,\",\"url\":\"https://google.com\"},{\"title\":\"Facebook – log in or sign up\",\"screenShot\":\"data:image/png;base64,\",\"url\":\"https://fb.com\",\"uuid\":\"466d2a9a-3977-4b72-81e3-5e41b3062a55\"}]");
    if (items.length > 0) {
        items.forEach(item => {
            this.addItem(item, false);
        });
    }
    checkItems && checkItems(true);
};

exports.deleteItemsFromLocalStorage = (uuid, checkItems = null) => {
    let localItems = this.getItemsFromLocalStorage();
    localItems     = localItems.filter(item => item.uuid !== uuid);
    localStorage.setItem('items', JSON.stringify(localItems));
    checkItems && checkItems(true);
}